import React from 'react';
import DeleteForeverIcon from '@mui/icons-material/DeleteForever';

const List =(props)=>{
    return(
        <>
             <div className="list-group">
                <div className="dlt"> 
                <DeleteForeverIcon />
                </div>
                <div>
                  <li style={{textDecoration:'line-through' }} className="lst">{props.val}</li>
                </div>
              </div>
        </>
    )
};

export default List;
